// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import "./ICondominium.sol";
import {CondominiumLib as Lib} from "./CondominiumLib.sol";

contract Condominium is ICondominium {
    address public manager;
    uint public monthlyQuota = 0.001 ether;

    mapping(uint16 => bool) public residences;
    mapping(address => uint16) public residents;
    mapping(address => bool) public counselors;

    mapping(uint16 => uint) public payments;

    mapping(bytes32 => Lib.Topic) public topics;
    mapping(bytes32 => Lib.Vote[]) public votings;

    constructor() {
        manager = msg.sender;

        for (uint16 i = 1; i <= 2; i++) {
            for (uint16 j = 1; j <= 5; j++) {
                for (uint16 k = 1; k <= 5; k++) {
                    residences[(i * 1000) + (j * 100) + k] = true;
                }
            }
        }
    }

    modifier onlyManager() {
        require(tx.origin == manager, "Only the manager can do this");
        _;
    }

    modifier onlyCouncil() {
        require(
            tx.origin == manager || counselors[tx.origin],
            "Only the manager or the council can do this"
        );
        _;
    }

    modifier onlyResidents() {
        require(
            tx.origin == manager || isResident(tx.origin),
            "Only the manager or the residents can do this"
        );
        require(
            tx.origin == manager ||
                block.timestamp <
                payments[residents[tx.origin]] + (30 * 24 * 60 * 60),
            "The resident must be defaulter"
        );
        _;
    }

    modifier validAddress(address addr) {
        require(addr != address(0), "Invalid address");
        _;
    }

    function residenceExists(uint16 residence) public view returns (bool) {
        return residences[residence];
    }

    function isResident(address resident) public view returns (bool) {
        return residents[resident] > 0;
    }

    function addResident(
        address resident,
        uint16 residenceId
    ) external onlyCouncil validAddress(resident) {
        require(residenceExists(residenceId), "Residence does not exist");
        residents[resident] = residenceId;
    }

    function removeResident(address resident) external onlyManager {
        require(!counselors[resident], "A counselor cannot be removed");
        delete residents[resident];
    }

    function setCounselor(
        address resident,
        bool isEntering
    ) external onlyManager validAddress(resident) {
        if (isEntering) {
            require(isResident(resident), "The counselor must be a resident");
            counselors[resident] = true;
        } else {
            delete counselors[resident];
        }
    }

    function getTopic(
        string memory title
    ) public view returns (Lib.Topic memory) {
        bytes32 topicId = keccak256(bytes(title));

        return topics[topicId];
    }

    function topicExists(string memory title) public view returns (bool) {
        return getTopic(title).createdDate > 0;
    }

    function addTopic(
        string memory title,
        string memory description,
        Lib.Category category,
        uint256 amount,
        address responsible
    ) external onlyResidents {
        require(!topicExists(title), "Topic already exists");
        if (amount > 0) {
            require(
                category == Lib.Category.CHANGE_QUOTA ||
                    category == Lib.Category.SPENT,
                "Wrong category"
            );
        }

        bytes32 topicId = keccak256(bytes(title));

        Lib.Topic memory newTopic = Lib.Topic({
            title: title,
            description: description,
            status: Lib.Status.IDLE,
            category: category,
            amount: amount,
            responsible: responsible != address(0) ? responsible : tx.origin,
            createdDate: block.timestamp,
            startDate: 0,
            endDate: 0
        });

        topics[topicId] = newTopic;
    }

    function removeTopic(
        string memory title
    ) external onlyManager returns (Lib.TopicUpdate memory) {
        require(topicExists(title), "Topic does not exists");

        Lib.Topic memory topic = getTopic(title);

        require(
            topic.status == Lib.Status.IDLE,
            "Only IDLE topics can be removed"
        );

        bytes32 topicId = keccak256(bytes(title));

        delete topics[topicId];

        return
            Lib.TopicUpdate({
                id: topicId,
                title: topic.title,
                category: topic.category,
                status: Lib.Status.DELETED
            });
    }

    function openVoting(
        string memory title
    ) external onlyManager returns (Lib.TopicUpdate memory) {
        require(topicExists(title), "Topic does not exists");

        Lib.Topic memory topic = getTopic(title);

        require(
            topic.status == Lib.Status.IDLE,
            "Only IDLE topics can be open to voting"
        );

        bytes32 topicId = keccak256(bytes(title));

        topics[topicId].status = Lib.Status.VOTING;
        topics[topicId].startDate = block.timestamp;

        return
            Lib.TopicUpdate({
                id: topicId,
                title: topic.title,
                category: topic.category,
                status: Lib.Status.VOTING
            });
    }

    function vote(
        string memory title,
        Lib.Options option
    ) external onlyResidents {
        require(option != Lib.Options.EMPTY, "The option cannot be EMPTY");
        require(topicExists(title), "Topic does not exists");

        Lib.Topic memory topic = getTopic(title);

        require(
            topic.status == Lib.Status.VOTING,
            "Only VOTING topics can be voted"
        );

        bytes32 topicId = keccak256(bytes(title));

        uint16 residence = residents[tx.origin];

        Lib.Vote[] memory votes = votings[topicId];

        for (uint8 i = 0; i < votes.length; i++) {
            require(
                votes[i].residence != residence,
                "A residence should vote only once"
            );
        }

        Lib.Vote memory newVote = Lib.Vote({
            resident: tx.origin,
            residence: residence,
            option: option,
            timestamp: block.timestamp
        });

        votings[topicId].push(newVote);
    }

    function editTopic(
        string memory topicToEdit,
        string memory description,
        uint256 amount,
        address responsible
    ) external onlyManager returns (Lib.TopicUpdate memory) {
        require(topicExists(topicToEdit), "This topic does not exists");

        Lib.Topic memory topic = getTopic(topicToEdit);
        require(
            topic.status == Lib.Status.IDLE,
            "Only IDLE topics can be edited"
        );

        bytes32 topicId = keccak256(bytes(topicToEdit));

        if (bytes(description).length > 0) {
            topics[topicId].description = description;
        }

        if (amount > 0) {
            topics[topicId].amount = amount;
        }

        if (responsible != address(0)) {
            topics[topicId].responsible = responsible;
        }

        return
            Lib.TopicUpdate({
                id: topicId,
                title: topic.title,
                category: topic.category,
                status: topic.status
            });
    }

    function closeVoting(
        string memory title
    ) external onlyManager returns (Lib.TopicUpdate memory) {
        require(topicExists(title), "Topic does not exists");

        Lib.Topic memory topic = getTopic(title);

        require(
            topic.status == Lib.Status.VOTING,
            "Only VOTING topics can be closed"
        );

        uint8 minimumVotes = 5;

        if (topic.category == Lib.Category.SPENT) {
            minimumVotes = 10;
        } else if (topic.category == Lib.Category.CHANGE_MANAGER) {
            minimumVotes = 15;
        } else if (topic.category == Lib.Category.CHANGE_QUOTA) {
            minimumVotes = 17;
        }

        require(
            numberOfVotes(title) >= minimumVotes,
            "You cannot finish a voting without the minimum votes"
        );

        uint8 approved = 0;
        uint8 denied = 0;
        uint8 abstentions = 0;

        bytes32 topicId = keccak256(bytes(title));
        Lib.Vote[] memory votes = votings[topicId];

        for (uint8 i = 0; i < votes.length; i++) {
            if (votes[i].option == Lib.Options.YES) {
                approved++;
            } else if (votes[i].option == Lib.Options.NO) {
                denied++;
            } else abstentions++;
        }

        Lib.Status newStatus = approved > denied
            ? Lib.Status.APPROVED
            : Lib.Status.DENIED;

        topics[topicId].status = newStatus;
        topics[topicId].endDate = block.timestamp;

        if (newStatus == Lib.Status.APPROVED) {
            if (topic.category == Lib.Category.CHANGE_QUOTA) {
                monthlyQuota = topic.amount;
            } else if (topic.category == Lib.Category.CHANGE_MANAGER) {
                manager = topic.responsible;
            }
        }

        return
            Lib.TopicUpdate({
                id: topicId,
                title: topic.title,
                category: topic.category,
                status: newStatus
            });
    }

    function numberOfVotes(string memory title) public view returns (uint256) {
        bytes32 topicId = keccak256(bytes(title));

        return votings[topicId].length;
    }

    function payQuota(uint16 residenceId) external payable {
        require(residenceExists(residenceId), "The residence does not exists");
        require(msg.value >= monthlyQuota, "Wrong value");
        require(
            block.timestamp > payments[residenceId] + (30 * 24 * 60 * 60),
            "You cannot pay twice a month"
        );
        payments[residenceId] = block.timestamp;
    }

    function transfer(
        string memory topicTitle,
        uint256 amount
    ) external onlyManager returns (Lib.TransferReceipt memory) {
        require(address(this).balance >= amount, "Insufficient funds");

        Lib.Topic memory topic = getTopic(topicTitle);

        require(
            topic.status == Lib.Status.APPROVED &&
                topic.category == Lib.Category.SPENT,
            "Only APPROVED SPENT topics can be used for transfers"
        );
        require(
            topic.amount >= amount,
            "The amount must be less or equal the APPROVED topic"
        );

        payable(topic.responsible).transfer(amount);

        bytes32 topicId = keccak256(bytes(topicTitle));
        topics[topicId].status = Lib.Status.SPENT;

        return
            Lib.TransferReceipt({
                to: topic.responsible,
                amount: amount,
                topic: topicTitle
            });
    }

    function getManager() external view returns (address) {
        return manager;
    }

    function getQuota() external view returns (uint256) {
        return monthlyQuota;
    }
}

contracts/CondominiumAdapter.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

import "./ICondominium.sol";

contract CondominiumAdapter {
    ICondominium private implementation;
    address public immutable owner;

    event QuotaChanged(uint256 amount);

    event ManagerChanged(address manager);

    event TopicChanged(
        bytes32 indexed topicId,
        string title,
        Lib.Status indexed status
    );

    event Transfer(address to, uint256 indexed amount, string topic);

    constructor() {
        owner = msg.sender;
    }

    modifier upgraded() {
        require(
            address(implementation) != address(0),
            "You must upgrade first"
        );
        _;
    }

    function getImplementationAddress() external view returns (address) {
        return address(implementation);
    }

    function upgrade(address newImplementation) external {
        require(msg.sender == owner, "You do not have permission");
        implementation = ICondominium(newImplementation);
    }

    function addResident(
        address resident,
        uint16 residenceId
    ) external upgraded {
        return implementation.addResident(resident, residenceId);
    }

    function removeResident(address resident) external upgraded {
        return implementation.removeResident(resident);
    }

    function setCounselor(address resident, bool isEntering) external upgraded {
        return implementation.setCounselor(resident, isEntering);
    }

    function addTopic(
        string memory title,
        string memory description,
        Lib.Category category,
        uint256 amount,
        address responsible
    ) external upgraded {
        return
            implementation.addTopic(
                title,
                description,
                category,
                amount,
                responsible
            );
    }

    function editTopic(
        string memory topicToEdit,
        string memory description,
        uint256 amount,
        address responsible
    ) external upgraded {
        Lib.TopicUpdate memory topic = implementation.editTopic(
            topicToEdit,
            description,
            amount,
            responsible
        );

        emit TopicChanged(topic.id, topic.title, topic.status);
    }

    function removeTopic(string memory title) external upgraded {
        Lib.TopicUpdate memory topic = implementation.removeTopic(title);

        emit TopicChanged(topic.id, topic.title, topic.status);
    }

    function openVoting(string memory title) external upgraded {
        Lib.TopicUpdate memory topic = implementation.openVoting(title);

        emit TopicChanged(topic.id, topic.title, topic.status);
    }

    function vote(string memory title, Lib.Options option) external upgraded {
        return implementation.vote(title, option);
    }

    function closeVoting(string memory title) external upgraded {
        Lib.TopicUpdate memory topic = implementation.closeVoting(title);

        emit TopicChanged(topic.id, topic.title, topic.status);

        if (topic.status == Lib.Status.APPROVED) {
            if (topic.category == Lib.Category.CHANGE_MANAGER) {
                emit ManagerChanged(implementation.getManager());
            } else if (topic.category == Lib.Category.CHANGE_QUOTA) {
                emit QuotaChanged(implementation.getQuota());
            }
        }
    }

    function payQuota(uint16 residenceId) external payable upgraded {
        return implementation.payQuota{value: msg.value}(residenceId);
    }

    function transfer(
        string memory topicTitle,
        uint256 amount
    ) external upgraded {
        Lib.TransferReceipt memory receipt = implementation.transfer(
            topicTitle,
            amount
        );

        emit Transfer(receipt.to, receipt.amount, receipt.topic);
    }

    function getManager() external view upgraded returns (address) {
        return implementation.getManager();
    }

    function getQuota() external view upgraded returns (uint256) {
        return implementation.getQuota();
    }
}

contracts/CondominiumLib.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

library CondominiumLib {
    enum Status {
        IDLE,
        VOTING,
        APPROVED,
        DENIED,
        DELETED,
        SPENT
    }

    enum Options {
        EMPTY,
        YES,
        NO,
        ABSTENTION
    }

    enum Category {
        DECISION,
        SPENT,
        CHANGE_QUOTA,
        CHANGE_MANAGER
    }

    struct Topic {
        string title;
        string description;
        Status status;
        Category category;
        uint256 amount;
        address responsible;
        uint256 createdDate;
        uint256 startDate;
        uint256 endDate;
    }

    struct Vote {
        address resident;
        uint16 residence;
        Options option;
        uint256 timestamp;
    }

    struct TopicUpdate {
        bytes32 id;
        string title;
        Status status;
        Category category;
    }

    struct TransferReceipt {
        address to;
        uint256 amount;
        string topic;
    }
}

